Sure! One way to extend the lifetime of a variable in Rust is by creating a reference to it. For example, consider the following code:

```rust
fn main() {
    let my_string = String::from("hello");
    let my_ref = &my_string; // creates a reference to my_string
    // my_string will live until the end of this block because my_ref is borrowing it
    println!("{}", my_ref);
}
```

In this code, `my_string` is a String variable that is created in the first line. Then, in the second line, a reference to `my_string` is created and assigned to `my_ref`. Because `my_ref` is borrowing `my_string`, the Rust compiler knows that `my_string` must live at least as long as `my_ref`. Therefore, `my_string` will not be dropped until the end of the block, which is after the `println!()` statement.

By creating a reference to `my_string`, we have effectively extended its lifetime beyond the end of the line where it was declared. This is just one example of how you can extend the lifetime of a variable in Rust.

