Here's a simple example of a Rust program that calculates the factorial of a number:

// Import the standard library's `io` module to get input/output capabilities
use std::io;

// Define the `main` function, the entry point of every Rust program
fn main() {
    // Read a number from the user and store it in `num`
    let mut num = String::new();
    io::stdin().read_line(&mut num).unwrap();
    let num = num.trim().parse::<u64>().unwrap();

    // Calculate the factorial of `num` and store it in `result`
    let result = (1..=num).fold(1, |acc, x| acc * x);

    // Print the result
    println!("{}! = {}", num, result);
}


Explanation:

The first line use std::io imports the standard library's io module, which provides input/output capabilities for the program.
The main function is defined using fn main(). This function is the entry point of every Rust program and is executed first when the program is run.
The next section uses the read_line method of the stdin object to read a line of input from the user and store it in a string num. The unwrap method is used to handle any potential errors that might occur during this process.
The string num is then converted to an unsigned 64-bit integer using parse and stored in the num variable.
The next section calculates the factorial of num using the fold method. This method takes a range of numbers (in this case, 1..=num) and applies a function to each number in the range, accumulating the results. In this case, the function multiplies each number in the range with the accumulated result. The final value of the accumulation is stored in the result variable.
Finally, the result is printed using the println! macro, which is similar to the printf function in C. The {} syntax is used to insert the values of num and result into the string.

